import React from 'react';

export interface IButton {
  children: React.ReactNode;
  marginTop?: number;
  marginBottom?: number;
  as?: any;
  className?: string;
}

const Button: React.FC<IButton> =
  ({ children,
     marginTop,
     marginBottom,
     as,
     className }) => {
  return (
    <button>{children}</button>
  )
};

export default Button;
